import React, { useRef, useState } from "react";
import { Clock, MapPin } from "lucide-react";
import { motion, useMotionValue, useSpring, useTransform } from "framer-motion";

// Card component with follow effect
function FollowCard({ children, className = "" }) {
  const ref = useRef(null);
  const [hovered, setHovered] = useState(false);

  const x = useMotionValue(0);
  const y = useMotionValue(0);

  const mouseX = useSpring(x, { stiffness: 500, damping: 100 });
  const mouseY = useSpring(y, { stiffness: 500, damping: 100 });

  const rotateX = useTransform(mouseY, [-50, 50], [5, -5]);
  const rotateY = useTransform(mouseX, [-50, 50], [-5, 5]);

  function handleMouseMove(e) {
    if (!ref.current) return;
    const rect = ref.current.getBoundingClientRect();
    const centerX = rect.left + rect.width / 2;
    const centerY = rect.top + rect.height / 2;

    x.set(e.clientX - centerX);
    y.set(e.clientY - centerY);
  }

  function handleMouseLeave() {
    x.set(0);
    y.set(0);
    setHovered(false);
  }

  return (
    <motion.div
      ref={ref}
      className={`relative ${className}`}
      onMouseMove={handleMouseMove}
      onMouseEnter={() => setHovered(true)}
      onMouseLeave={handleMouseLeave}
      style={{
        perspective: 1000,
        transformStyle: "preserve-3d",
      }}
    >
      <motion.div
        style={{
          rotateX: hovered ? rotateX : 0,
          rotateY: hovered ? rotateY : 0,
          transformStyle: "preserve-3d",
        }}
        transition={{
          type: "spring",
          damping: 20,
          stiffness: 300,
        }}
      >
        {children}
      </motion.div>
    </motion.div>
  );
}

// Venue Card Component - Floating on top of UI
function VenueCard({ image, name, time, type, emoji, className = "" }) {
  return (
    <div className={`${className} bg-white rounded-xl overflow-hidden shadow-lg border border-gray-100 w-full z-20`}>
      <div className="flex p-3 gap-3">
        <div className="w-10 h-10 rounded-lg overflow-hidden flex-shrink-0">
          <img
            src={image || "/placeholder.svg"}
            alt={name}
            className="w-full h-full object-cover"
          />
        </div>
        <div className="flex-1">
          <h3 className="font-bold text-sm text-gray-900">{name}</h3>
          <div className="flex items-center text-gray-500 mt-1 text-xs">
            <Clock className="w-3 h-3 mr-1" />
            <span>{time} min away</span>
          </div>
          <div className="mt-1">
            <span className="inline-flex items-center px-2 py-0.5 rounded-full text-xs bg-gray-100">
              {emoji} {type}
            </span>
          </div>
        </div>
      </div>
      <div className="bg-black text-white p-2 flex items-center justify-center gap-1 hover:bg-gray-800 transition-colors cursor-pointer">
        <MapPin className="w-3 h-3" />
        <span className="text-xs">Get Directions</span>
      </div>
    </div>
  );
}

// Button Component
function Button({ children, className = "", size = "md", variant = "default" }) {
  const sizeClasses = {
    md: "py-2 px-4",
    lg: "py-3 px-6",
  };

  const variantClasses = {
    default: "bg-black hover:bg-black/90 text-white",
    outline: "bg-transparent border border-gray-300 text-gray-700 hover:bg-gray-50",
  };

  return (
    <button 
      className={`${sizeClasses[size]} ${variantClasses[variant]} rounded-full transition-colors ${className}`}
    >
      {children}
    </button>
  );
}

// Main App Component
function MeepEarth() {
  return (
    <div className="min-h-screen bg-gray-50">
      <header className="py-4 px-6 bg-white">
        <div className="container mx-auto flex justify-between items-center">
          <div className="flex items-center gap-2">
            <img
              src="https://hebbkx1anhila5yf.public.blob.vercel-storage.com/Logo-CTSh56ETSnD9ussJzfSa5Vm8JHsceV.png"
              alt="Meep logo"
              width={36}
              height={36}
              className="rounded-full"
            />
            <span className="font-medium text-lg">Meep</span>
          </div>

          <div className="flex items-center gap-4">
            <div className="text-sm text-gray-500">
              {new Date().toLocaleTimeString([], { hour: "2-digit", minute: "2-digit" })} 
            </div>
            <Button className="bg-black hover:bg-black/90 text-white">Download App</Button>
          </div>
        </div>
      </header>

      <main className="py-16">
        <div className="container mx-auto px-6">
          <div className="grid md:grid-cols-2 gap-16 items-center">
            {/* Left column - Text content */}
            <div>
              <div className="mb-2">
                <img
                  src="https://hebbkx1anhila5yf.public.blob.vercel-storage.com/Logo-CTSh56ETSnD9ussJzfSa5Vm8JHsceV.png"
                  alt="Meep logo"
                  width={40}
                  height={40}
                  className="rounded-full"
                />
              </div>

              <h1 className="text-5xl md:text-6xl font-bold tracking-tight mb-6 text-black">
                Perfect
                <br />
                meeting points
                <br />
                <span className="bg-gradient-to-r from-blue-500 to-teal-400 text-transparent bg-clip-text">
                  start here.
                </span>
              </h1>

              <p className="text-xl text-gray-600 mb-8 max-w-md">
                Find the ideal spot to meet your friends, halfway between your locations.
